import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './UserDashboard.scss';
import UserSidebar from '../../components/UserSidebar/UserSidebar';

const UserDashboard: React.FC = () => {
    const [userName, setUserName] = useState('');
    const [addresses, setAddresses] = useState<any[]>([]); // Dodaj stan dla wszystkich adresów
    const navigate = useNavigate();

    useEffect(() => {
        const fetchUserData = async () => {
            const token = sessionStorage.getItem('auth_token');
            if (!token) return;

            const query = `
                query {
                    customer {
                        firstname
                        lastname
                        addresses {
                            id
                            firstname
                            lastname
                            street
                            city
                            region {
                                region
                                region_code
                                region_id
                            }
                            postcode
                            country_code
                            telephone
                        }
                    }
                }
            `;

            try {
                const response = await fetch('http://mint.local/graphql', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${token}`,
                    },
                    body: JSON.stringify({ query }),
                });

                const result = await response.json();
                if (result.data && result.data.customer) {
                    setUserName(result.data.customer.firstname);
                    setAddresses(result.data.customer.addresses); // Ustaw adresy
                }
            } catch (err) {
                console.error("Error fetching user data:", err);
            }
        };

        fetchUserData();
    }, []);

    const handleLogout = () => {
        sessionStorage.removeItem('auth_token');
        sessionStorage.removeItem('user_name');
        navigate('/login');
    };

    return (
        <div className="user-dashboard">
            <UserSidebar/>

            <div className="user-dashboard__content">
                <h2>Welcome, {userName}</h2>
                <section>
                    <h3>Account Information</h3>
                    <div className="info-section">
                        <div className="contact-info">
                            <h4>Contact Information</h4>
                            <div></div>
                            <a href="#">Edit</a> | <a href="#">Change Password</a>
                        </div>
                        <div className="newsletter">
                            <h4>Newsletters</h4>
                            <div></div>
                            <a href="#">Edit</a>
                        </div>
                    </div>

                    <h3>Address Book</h3>
                    <div className="info-section">
                        <div>
                            <h4>All Addresses</h4>
                            <div className="address-list">
                                {addresses.length > 0 ? (
                                    addresses.map(address => (
                                        <div key={address.id} className="address-item">
                                            <h4>{address.firstname} {address.lastname}</h4>
                                            <p><strong>Ulica:</strong> {address.street.join(', ')}</p>
                                            <p><strong>Miasto:</strong> {address.city}</p>
                                            <p><strong>Region:</strong> {address.region?.region}</p>
                                            <p><strong>Kod pocztowy:</strong> {address.postcode}</p>
                                            <p><strong>Kod kraju:</strong> {address.country_code}</p>
                                            <p><strong>Telefon:</strong> {address.telephone}</p>
                                            <a href="/AddressBook">Edit Address</a>
                                        </div>
                                    ))
                                ) : (
                                    <p>No addresses found.</p>
                                )}
                            </div>
                        </div>
                    </div>
                </section>
                <button onClick={handleLogout} className="logout-button">
                    Logout
                </button>
            </div>
        </div>
    );
};

export default UserDashboard;
